"    <div id=\"topicTitle\">",
"     Patient information: Pleural effusion (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/pleural-effusion-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H6662402\">",
"      <span class=\"h1\">",
"       What is pleural effusion?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Pleural effusion is a buildup of fluid around the lungs (",
"      <a class=\"graphic graphic_figure graphicRef67527 \" href=\"UTD.htm?40/17/41237\">",
"       figure 1",
"      </a>",
"      ). It is sometimes called &ldquo;water on the lungs.&rdquo; Heart failure is the most common cause of this problem. Pleural effusion can also be caused by an infection, cancer, or other health problems.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6662417\">",
"      <span class=\"h1\">",
"       What are the symptoms of pleural effusion?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Chest pain &ndash; This pain can be sharp and get worse when you cough or take a deep breath. Sometimes the pain is a dull ache.",
"       </li>",
"       <li>",
"        Breathing problems &ndash; You might breathe faster than normal or feel short of breath.",
"       </li>",
"       <li>",
"        Cough",
"       </li>",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Hiccups",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6662432\">",
"      <span class=\"h1\">",
"       Will I need tests for pleural effusion?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Tests for pleural effusion include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        An X-ray of your chest",
"       </li>",
"       <li>",
"        A CT scan - This is a special type of X-ray.",
"       </li>",
"       <li>",
"        Ultrasound &ndash; This test uses sound waves to take pictures of the organs inside your body. Your doctor might do this test if you need to have some fluid taken out.",
"       </li>",
"       <li>",
"        A test in which a doctor takes a small sample of fluid from around your lung using a needle. Another doctor then checks the sample under a microscope.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6662447\">",
"      <span class=\"h1\">",
"       How is pleural effusion treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The treatment depends on your symptoms and the cause of the problem. If you are having trouble breathing, your doctor will remove the fluid from around your lungs with a needle or plastic tube.",
"     </p>",
"     <p>",
"      If heart failure caused the fluid around your lungs, your doctor will prescribe medicines called &ldquo;diuretics.&rdquo; These help pull fluid out of your lungs. Examples include",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?12/14/12518?source=see_link\">",
"       furosemide",
"      </a>",
"      (brand name: Lasix&reg;), and",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?36/44/37573?source=see_link\">",
"       torsemide",
"      </a>",
"      (brand name: Demadex&reg;). You might also need to take other medicines for heart failure.",
"     </p>",
"     <p>",
"      If an infection caused the fluid around your lungs, your doctor will prescribe antibiotics. Your doctor might put a flexible plastic tube into the fluid to drain the infection. This tube might stay in for a few days.",
"     </p>",
"     <p>",
"      If you have cancer and get fluid around your lungs, your doctor might put a flexible plastic tube in the side of your chest to drain away the extra fluid. Your doctor might leave the tube in for a few weeks and you will drain the fluid at home. You might also need chemotherapy.",
"     </p>",
"     <p>",
"      You also might need surgery to remove a small sample of tissue from around your lungs. This is called a &ldquo;biopsy.&rdquo; Tests on this tissue can help explain why the fluid keeps coming back. At the time of surgery, the doctor might use a powdery substance called &ldquo;talc&rdquo; to close the space and keep the fluid from returning.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6662463\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
