var title_f9_50_10028="Histologic idiopathic HTN";
var content_f9_50_10028=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F80624&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F80624&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Histologic findings in patients with idiopathic portal hypertension",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Histological feature*",
"       </td>",
"       <td class=\"subtitle1\">",
"        Frequency, percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Irregular intimal thickening of portal veins",
"       </td>",
"       <td>",
"        75-100&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Organizing thrombus and/or recanalization of portal veins",
"       </td>",
"       <td>",
"        20-100&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Intralobular fibrous septa",
"       </td>",
"       <td>",
"        95",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Abnormal blood vessels in the lobules",
"       </td>",
"       <td>",
"        75",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Subcapsular atrophy",
"       </td>",
"       <td>",
"        70",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dense portal fibrosis and portal venous obliteration",
"       </td>",
"       <td>",
"        32-52",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Periductal fibrosis of interlobular bile ducts",
"       </td>",
"       <td>",
"        50",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Portal inflammation",
"       </td>",
"       <td>",
"        47",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Nodular hyperplasia of parenchyma",
"       </td>",
"       <td>",
"        25-40",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Needle biopsies from patients with IPH are often normal or commonly show only nonspecific morphologic changes. Specific abnormalities are more commonly seen in larger wedge biopsies or autopsy specimens.",
"     <br>",
"      &bull; Studies showing findings in 100 percent of patients were based upon autopsy specimens.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br>",
"      1. Sarin SK, Kapoor D. Non-cirrhotic portal fibrosis: current concepts and management. J Gastroenterol Hepatol 2002; 17:526.",
"      <br>",
"       2. Hillaire S, Bonte E, Denninger MH, et al. Idiopathic non-cirrhotic intrahepatic portal hypertension in the West: a re-evaluation in 28 patients. Gut 2002; 51:275.",
"       <br>",
"        3. Ludwig J, Hashimoto E, Obata H, Baldus WP. Idiopathic portal hypertension; a histopathological study of 26 Japanese cases. Histopathology 1993; 22:227.",
"        <br>",
"         4. Nakanuma Y, Hoso M, Sasaki M, et al. Histopathology of the liver in non-cirrhotic portal hypertension of unknown aetiology. Histopathology 1996; 28:195.",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
